import React from "react";
import ReactDOM from "react-dom";
import App from "./components/App";
import Header from "./components/Header";
import { Router,Routes,Route } from "react-router-dom";

ReactDOM.render(
    <Router>
        <Routes>
            <Route exact path="/">
                <App />
            </Route>
        </Routes>
    </Router>
,document.getElementById('root'));
